import Header from "../components/HomePage/Header";
import Content from "../components/HomePage/Content";
// import NavbarNew from "../Navbar/NavbarNew";
// import Footer from "../Footer/Footer";

function HomePage() {
  return (
    <div>
      <div id="home_fix">
        {/* <NavbarNew /> */}
        <Header />
        <Content />
        {/* <Footer /> */}
      </div>
    </div>
  );
}

export default Home;
